import { Button, StyleSheet, Text, View, TextInput, Pressable } from 'react-native';

function ViewClients(params) {

    return (
        <View>
            {
                
                params.clients.map((c) => <Pressable key={c.clientName + c.contactEmail} onPress={alert()}><Text >{c.clientName}</Text></Pressable>)
            }
        </View>
    )
}

export default ViewClients;
